using SimpleHttpServer.Models;
using SimpleHttpServer.RouteHandlers;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace SimpleHttpServer.WebApp
{
    static class Routes
    {

        public static List<Route> GET
        {
            get
            {
                return new List<Route>()
                {
                    new Route()
                    {
                        Callable = HomeIndex,
                        UrlRegex = "^\\/$",
                        Method = "GET"
                    },
                    new Route()
                    {
                        Callable = OS,
                        UrlRegex = "/OS",
                        Method = "GET"
                    },
                    new Route()
                    {
                        Callable = IMG,
                        UrlRegex = "/IMG",
                        Method = "GET"
                    },
                    new Route()
                    {
                        Callable = new FileSystemRouteHandler() { BasePath = @"D:\OS_SERVER\Static"}.Handle,
                        UrlRegex = "^\\/Static\\/(.*)$",
                        Method = "GET"
                    }
                };

            }
        }

        private static HttpResponse HomeIndex(HttpRequest request)
        {
            return new HttpResponse()
            {
                ContentAsUTF8 = "<html><title>OS Project: Team 19</title><h1>\"Welcome to the OS class\"</h1><br>This is my first web page!</html>",
                ReasonPhrase = "OK",
                StatusCode = "200"
            };

        }

        private static HttpResponse OS(HttpRequest request)
        {
            return new HttpResponse()
            {
                ContentAsUTF8 = "<html><title>OS Project: Team 19</title><h1>OPERATING SYSTEM CMPE180-C </h1><br><h2>Project:Operating System </h2><br><h3> ID : CMPE-180C </h3><br> Team : 19</html>",
                ReasonPhrase = "OK",
                StatusCode = "200"
            };

        }

        private static HttpResponse IMG(HttpRequest request)
        {
            return new HttpResponse()
            {
                ContentAsUTF8 = "<html><title>OS Project: Team 19</title><h1>OPERATING SYSTEM CMPE180-C </h1><br>" +
                "<img width='1000' src ='data:image/jpeg;base64,'></html>",
                ReasonPhrase = "OK",
                StatusCode = "200"
            };

        }

        
    }
}
